import React from 'react';

const ComoFunciona = () => {
    return ( 
        <div className="comofunciona">
            <h1>Como Funciona nuestra página?</h1>
            <br/>
            <p>En nuestra tienda usted prodrá: </p>
            <ul>
                <li>Obtener información sobre nuestros servicio y sobre la empresa.</li>
                <li>Buscar, encontrar, evaluar y comparar nuestros servicios.</li>
                <li>Seleccionar servicios.</li>
                <li>Comparar precios con otras empresas.</li>
                <li>Obtener descuentos según la temporada</li>
                <li>Realizar compras.</li>
                <li>Pagar por las reservas realizadas</li>
                <li>Obtener información sobre sus reservas actuales o antiguas.</li>           
            </ul>
        </div>
     );
}

export default ComoFunciona ;
